        "content": "{\n  \"name\": \"flynndev\",\n  \"version\": \"1.0.0\",\n  \"description\": \"FlynnDev\",\n  \"main\": \"index.html\",\n  \"scripts\": {\n    \"build\": \"apidoc -i routes/ -o api/ && rimraf dist && webpack --config config/webpack.prod.js --progress --profile --bail\",\n    \"deploy\": \"git add . && git commit && git push origin master\",\n    \"autodeploy\": \"git add . && git commit -m 'Auto Deployment' && git push origin master\",\n    \"devdeploy\": \"git add . && git commit -m 'Auto Deployment' && git push origin master\"\n  },\n  \"author\": \"Michael Flynn\",\n  \"licenses\": [\n    {\n      \"type\": \"MIT\",\n      \"url\": \"https://github.com/angular/angular.io/blob/master/LICENSE\"\n    }\n  ],\n  \"dependencies\": {\n    \"@angular/common\": \"2.1.1\",\n    \"@angular/compiler\": \"2.1.1\",\n    \"@angular/core\": \"2.1.1\",\n    \"@angular/forms\": \"2.1.1\",\n    \"@angular/http\": \"2.1.1\",\n    \"@angular/platform-browser\": \"2.1.1\",\n    \"@angular/platform-browser-dynamic\": \"2.1.1\",\n    \"@angular/router\": \"3.1.1\",\n    \"@angular/upgrade\": \"2.1.1\",\n    \"@types/core-js\": \"0.9.34\",\n    \"@types/jasmine\": \"2.5.41\",\n    \"@types/node\": \"6.0.45\",\n    \"angular2-template-loader\": \"0.4.0\",\n    \"angulartics2\": \"1.4.2\",\n    \"autoprefixer\": \"6.5.3\",\n    \"awesome-typescript-loader\": \"2.2.4\",\n    \"typescript\": \"2.0.10\",\n    \"body-parser\": \"1.15.2\",\n    \"bootstrap-loader\": \"1.0.8\",\n    \"bootstrap-sass\": \"3.3.7\",\n    \"core-js\": \"2.4.1\",\n    \"css-loader\": \"0.23.1\",\n    \"express\": \"4.14.0\",\n    \"extract-text-webpack-plugin\": \"1.0.1\",\n    \"file-loader\": \"0.8.5\",\n    \"font-awesome\": \"4.7.0\",\n    \"font-awesome-loader\": \"1.0.0\",\n    \"highlight-loader\": \"0.7.2\",\n    \"highlight.js\": \"9.8.0\",\n    \"html-loader\": \"0.4.3\",\n    \"html-webpack-plugin\": \"2.29.0\",\n    \"imports-loader\": \"0.6.5\",\n    \"jasmine-core\": \"2.5.1\",\n    \"jquery\": \"3.1.1\",\n    \"jsonwebtoken\": \"7.1.9\",\n    \"minimatch\": \"3.0.3\",\n    \"morgan\": \"1.7.0\",\n    \"multimatch\": \"2.1.0\",\n    \"mysql\": \"2.12.0\",\n    \"node-sass\": \"3.11.3\",\n    \"nodemon\": \"1.11.0\",\n    \"null-loader\": \"0.1.1\",\n    \"postcss\": \"5.2.5\",\n    \"postcss-loader\": \"1.1.1\",\n    \"proxy-middleware\": \"0.15.0\",\n    \"raw-loader\": \"0.5.1\",\n    \"recursive-readdir-sync\": \"1.0.6\",\n    \"reflect-metadata\": \"0.1.8\",\n    \"resolve-url-loader\": \"1.6.0\",\n    \"rxjs\": \"5.0.0-beta.12\",\n    \"sass-loader\": \"4.0.2\",\n    \"sendmail\": \"1.1.1\",\n    \"sharp\": \"0.16.2\",\n    \"showdown\": \"1.6.4\",\n    \"style-loader\": \"0.13.1\",\n    \"tether\": \"1.3.7\",\n    \"tslint\": \"4.1.1\",\n    \"url-loader\": \"0.5.7\",\n    \"validator\": \"6.2.0\",\n    \"webpack\": \"1.13.3\",\n    \"webpack-dev-middleware\": \"1.8.4\",\n    \"webpack-dev-server\": \"1.16.2\",\n    \"webpack-merge\": \"0.14.1\",\n    \"zone.js\": \"0.6.25\"\n  },\n  \"apidoc\": {\n    \"name\": \"Portfolio API\",\n    \"title\": \"Portfolio API\",\n    \"url\": \"http://flynndev.us/api\"\n  },\n  \"liveurl\": \"http://flynndev.us\",\n  \"featured\": true,\n  \"unrestrictedfiles\": true,\n  \"tags\": [\n    \"Angular2\",\n    \"Bootstrap\",\n    \"jQuery\",\n    \"Webpack\",\n    \"ApiDoc\",\n    \"Express\",\n    \"API\",\n    \"Node.js\",\n    \"JWT\",\n    \"FlexBox\",\n    \"SASS\",\n    \"Font Awesome\"\n  ],\n  \"devDependencies\": {\n    \"apidoc\": \"^0.16.1\",\n    \"rimraf\": \"^2.6.1\"\n  }\n}\n"
