        "content": "{\n  \"apps\" : [\n\t{\n\t  \"name\"  : \"FlynnDev\",\n\t  \"script\": \"./frontend_server.js\",\n\t  \"watch\" : true\n\t},\n\t{\n\t  \"name\"  : \"FlynnDev-API\",\n\t  \"script\": \"./backend_server.js\",\n\t  \"watch\" : true\n\t},\n\t{\n\t  \"name\"   : \"FlynnDev-Dev\",\n\t  \"script\" : \"./dev_server.js\",\n\t  \"watch\" : true\n\t}\n  ]\n}"
