        "content": "<form #contactForm=\"ngForm\" (ngSubmit)=\"sendMessage()\" class=\"contact-form\" *ngIf=\" ! submitted \">\n\n\t<div class=\"form-group\">\n\n\t\t<label for=\"name\">Name</label>\n\n\t\t<input type=\"text\"  class=\"form-control\" id=\"name\" required [(ngModel)]=\" model.name \" (ngModelChange)=\"onModelChange()\" name=\"name\"  placeholder=\"Name\" #name=\"ngModel\" >\n\n\t\t<div [hidden]=\" name.valid || name.pristine \" class=\"alert alert-danger\">\n\t\t\tName is required\n\t\t</div>\n\n\t</div>\n\n\t<div class=\"form-group\">\n\n\t\t<label for=\"email\">Email address</label>\n\n\t\t<input type=\"email\" class=\"form-control\" id=\"email\" required [(ngModel)]=\"model.email \" (ngModelChange)=\"onModelChange()\" name=\"email\" placeholder=\"Email\"  #email=\"ngModel\" pattern=\"\\S+@\\S+\\.\\S+\">\n\n\t\t<div [hidden]=\" email.valid || email.pristine \" class=\"alert alert-danger\">\n\n\t\t\tEmail is invalid\n\n\t\t</div>\n\n\t</div>\n\n\t<div class=\"form-group\">\n\n\t\t<label for=\"content\">Message</label>\n\n\t\t<textarea class=\"form-control\" name=\"content\" id=\"content\" required placeholder=\"Message...\" [(ngModel)]=\" model.content \" (ngModelChange)=\"onModelChange()\" rows=\"3\"  #content=\"ngModel\"></textarea>\n\n\t\t<div [hidden]=\"content.valid || content.pristine\" class=\"alert alert-danger\">\n\n\t\t\tMessage is required\n\n\t\t</div>\n\n\t</div>\n\n\t<input type=\"submit\" class=\"btn btn-primary pull-right\" [disabled]=\" ! contactForm.form.valid \" value=\"Send Message\">\n\n</form>\n\n<div class=\"thank-you well well-lg\" *ngIf=\" submitted \">\n\n\tThanks!\n\n</div>\n\n"
