        "name": "nav.component.html",
        "content": "<nav class=\"navbar navbar-default navbar-fixed-top\">\n\t<div class=\"container\">\n\t\t<div class=\"navbar-header\">\n\t\t\t<a class=\"navbar-brand\" routerLink=\"/\">\n\t\t\t\tFlynnDev\n\t\t\t</a>\n\t\t</div>\n\t\t<button *ngIf=\"api.token\" class=\"btn btn-primary navbar-btn navbar-right\" (click)=\"api.logout($event)\">\n\t\t\t<i class=\"fa fa-sign-out\"></i>\n\t\t\tLogout\n\t\t</button>\n\t\t<button *ngIf=\"api.isAdmin()\" class=\"btn navbar-btn navbar-right hidden-phone\" [ngClass]=\"{'btn-primary': log.show , 'btn-secondary': ! log.show }\" (click)=\"log.toggle()\" alt=\"Toggle Console Log\">\n\t\t\t<i class=\"fa fa-cogs\"></i>\n\t\t</button>\n\t\t<button *ngIf=\"!api.token\" type=\"button\" class=\"btn btn-primary navbar-btn navbar-right\" data-toggle=\"modal\" data-target=\"#loginModal\">\n\t\t\t<i class=\"fa fa-sign-in\"></i>\n\t\t\tLogin\n\t\t</button>\n\t\t<p *ngIf=\"api.token\" class=\"navbar-text navbar-right userinfo hidden-phone\">\n\t\t\t<i class=\"fa fa-user\"></i> {{api.user.name}}\n\t\t</p>\n\n\t</div>\n</nav>"
