        "content": "@import \"../../config\";\n\n.navbar-brand{\n  font-family: \"coquette\",fantasy;\n  font-weight:bold;\n  color:$blue;\n  &:hover{\n\tcolor: $darker-blue;\n  }\n  font-size: 24px;\n}\n\n.navbar-header{\n  float: left;\n}\n\n.navbar-right {\n  margin-left: 30px;\n  float:right;\n}\n\n.hidden-phone {\n  @media only screen and (max-width: 480px) {\n    display: none;\n  }\n}\n\n.userinfo {\n\n  font-size: 1.2em;\n  i {\n    font-size: 1.2em;\n    margin-right: 10px;\n  }\n\n}\n\n"
