        "name": "featured-projects.component.html",
        "content": "<div class=\"projects_outer\">\n\t<div class=\"container\">\n\t\t<h2>Featured Projects\n\t\t\t<button class=\"pull-right btn-default btn\" (click)=\"projects.openAll($event)\" >View All</button>\n\t\t</h2>\n\t\t<div class=\"projects\">\n\t\t\t<div class=\"project-img\" *ngFor=\"let project of projects.featuredProjects\" (click)=\"projects.open($event, project)\">\n\t\t\t\t<img  *ngIf=\"project.thumb\" src=\"{{project.thumb}}/200\" alt=\"placeholder\" >\n\t\t\t\t<div class=\"title\">\n\t\t\t\t\t<p>{{project.name}}</p>\n\t\t\t\t</div>\n\t\t\t</div>\n\t\t</div>\n\t</div>\n</div>"
